        max-width: 800px;
        min-width: 800px;
        margin-left: auto;
        margin-right: auto;
    }

    .globalMain>.piece {
        margin-top: 55px;
        /* border: red solid 1px; */
    }

    .globalMain>.piece>.title {
        display: flex;
        justify-content: flex-start;
        align-items: center;
        color: #878787;
    }

    .title>.icon {
        height: 22px;
        width: 40px;
        fill: #878787;
    }

    .title>h2 {
        padding-left: 15px;

    }

    .siteList {
        /* border: 1px solid red; */
        display: flex;
        margin-left: 0px;
        justify-content: flex-start;
        flex-wrap: wrap;
        margin-right: -100px;
        margin: 28px;
        margin-left: 0;
    }

    .siteList>a>li {
        margin-bottom: 20px;
        margin-right: 20px;
    }

    .siteList .site {
        /* border: 1px solid #dddddd; */
        background-color: #2C2E2F;
        width: 133px;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        background: 2C2E2F;
        border-radius: 4px;
        padding: 16px 0;
        position: relative;
        cursor: pointer;
    }

    .site>.logo {
        /* border: 1px solid red; */
        height: 68px;
        width: 68px;
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 68px;
        border-radius: 100%;
        margin-top: -6px;
        margin-bottom: 6px;
        color: rgb(216, 214, 214);
    }

    .site>.logo>img {
        border-radius: 100%;

    }

    .site>.link {
        /* border: 1px solid red; */
        color: rgb(216, 214, 214);
        font-size: 14px;
        margin-bottom: -4px;
    }

    .lastList>.site {
        border: 1px solid #dddddd;
        width: 146px;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        background: white;
        border-radius: 4px;
        padding: 22px 0;
        position: relative;
        cursor: pointer;
    }

    .siteList .addButton {
        width: 133px;
        /* height: 127px; */
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        background-color: #2C2E2F;
        border-radius: 4px;
        padding: 16px 0;
        cursor: pointer;
    }

    .siteList .addButton .icon {
        height: 58px;
        width: 58px;
        margin-bottom: 10px;
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 68px;
        border-radius: 100%;
        fill: whitesmoke;
    }

    .siteList .addButton .text {
        color: rgb(216, 214, 214);
        font-size: 14px;
        margin-bottom: -4px;
    }

    .site>.close {
        display: none;
        cursor: default;
    }

    .site>.close>.icon {
        /* border: red solid 1px; */
        position: absolute;
        top: 5px;
        right: 5px;
        width: 1em;
        height: 1em;
        color: whitesmoke;
    }

    .site:hover>.close {
        display: block;
    }

    .lastList>li {
        margin-bottom: 20px;
        margin-right: 20px;
    }

    #自定义 {
        padding-bottom: 90px;
    }

    #自定义>.ps {
        background-color: #2C2E2F;
        color: whitesmoke;
    }

    .ps.active {
        background-color: #dadce0 !important;
        color: black !important;
    }
}

#shift {
    /* position: absolute; */
    bottom: 10vh;
    right: 10vh;
    border-radius: 48%;
    border: rgb(175, 165, 165) solid 1px;
    position: fixed;
}

#shift>.icon {
    height: 50px;
    width: 50px;
    border: cornsilk solid 1px;
    border-radius: 50%;
}

@media(max-width:500px) {
    #shift {
        bottom: 10vw;
        right: 10vw;
        opacity: 0.5;
    }

    .content.active {
        background-color: #FFFFFF;
    }

    .sidebar-main.active {
        background-color: #EAEAEB;
    }
}

